import React, {useState} from "react";
import ChecklistPresent from "./ChecklistPresent";

function Checklist({month, year, eventId, eventText}) {

    const [inputValue, setInputValue] = useState('');

    function handlerInputClick(event) {
        setInputValue(event.target.value);
    }

    return <div>
       <ChecklistPresent month={month} year={year} eventId={eventId} eventText={eventText} inputValue={inputValue} handlerInputClick={handlerInputClick} /> 
    </div>

}


export default Checklist;
